<template>
  <div class="login-warpper">
    <Top />
    <el-main class="login-box">
      <div class="flex-pos login-pos">
        <div class="login-mask"></div>
        <el-row>
          <el-col :span="24">
            <div class="login-title">保戶Ｅ園地</div>
          </el-col>
          <el-col :span="24">
            <el-form
              class="login-form"
              label-width="80px"
              :model="loginRule"
              :rules="rules"
              ref="loginRule"
              v-if="serverStatus"
            >
              <el-form-item prop="id_number">
                <el-input
                  v-model="loginRule.id_number"
                  prefix-icon="el-icon-postcard"
                  placeholder="身分證字號"
                  :maxlength="10"
                ></el-input>
              </el-form-item>
              <el-form-item prop="user_name">
                <el-input
                  v-model="loginRule.user_name"
                  prefix-icon="el-icon-user"
                  placeholder="使用者名稱"
                  :maxlength="12"
                  show-password
                ></el-input>
              </el-form-item>
              <el-form-item prop="user_password">
                <el-input
                  v-model="loginRule.user_password"
                  prefix-icon="el-icon-lock"
                  placeholder="密碼"
                  :maxlength="12"
                  show-password
                ></el-input>
              </el-form-item>
              <div class="captcha-box flex-row">
                <el-form-item prop="captcha">
                  <el-input
                    placeholder="驗證碼"
                    prefix-icon="el-icon-c-scale-to-original"
                    v-model="loginRule.captcha"
                    :maxlength="4"
                    class="captcha-input"
                  ></el-input>
                </el-form-item>
                <div class="captcha-img">
                  <captcha :identifyCode="identifyCode"></captcha>
                </div>
                <div class="reform" @click="refreshCode()">
                  <i class="el-icon-refresh-right"></i>
                </div>
              </div>
              <div class="flex-box">
                <div class="flex-pos">
                  <el-row class="btn-box">
                    <el-col :span="24" class="top-btn">
                      <el-button
                        class="btn-blue"
                        @click="submitForm('loginRule')"
                        >登入</el-button
                      >
                    </el-col>
                    <el-col :xs="24" :sm="24" :md="24" :lg="24">
                      <div class="flex-row">
                        <el-button class="btn-gray" @click="forgetAccount"
                          >忘記使用者名稱密碼</el-button
                        >
                        <el-button class="btn-yellow-login" @click="signUp"
                          >申請加入會員</el-button
                        >
                      </div>
                    </el-col>
                  </el-row>
                </div>
              </div>
            </el-form>
            <div v-if="!serverStatus" class="login-form" label-width="80px">
              <span style="color:red"
                >保戶系統維護中，預計{{
                  openTime
                }}重新提供服務，如有問題可撥打客服中心電話0800-015000</span
              >
            </div>
          </el-col>
        </el-row>
      </div>
