    <Bottom />
  </div>
</template>

<script>
// @ is an alias to /src
import Top from "@/components/Top.vue";
import Captcha from "../components/Captcha";
import Bottom from "@/components/index/Bottom.vue";
import loginData from "../mock/login";
import { mapActions, mapGetters } from "vuex";
export default {
  name: "login",
  components: {
    Captcha,
    Top,
    Bottom
  },
  data() {
    const checkCaptcha = (rule, value, callback) => {
      if (!value) {
        // return callback(new Error("驗證碼不能為空"));
      }
      setTimeout(() => {
        // if (value.length != 4) {
        //   callback(new Error("請輸入完整驗證碼"));
        // } else {
        if (value != this.identifyCode) {
          callback(new Error("驗證碼錯誤"));
        } else {
          callback();
          // }
        }
      }, 1000);
    };
    return {
      serverStatus: loginData.ServerStatus.status,
      openTime: loginData.ServerStatus.openTime,
      loginButtonIsDisable: false,
      otpDialog: false,
      loginDialog: false,
      dialogType: 0,
      loginRule: {
        id_number: "",
        user_name: "",
        user_password: "",
        captcha: ""
      },
      identifyCode: "1324",
      //隨機碼素材
      identifyCodes: "0123456789abcdwerwshdjeJKDHRJHKOOPLMKQ",
      rules: {
        id_number: [
          { required: true, message: "請輸入身分證字號", trigger: "blur" }
        ],
        user_name: [
          { required: true, message: "請輸入使用者名稱", trigger: "blur" }
        ],
        user_password: [
          { required: true, message: "請輸入密碼", trigger: "blur" }
        ],
        captcha: [
          { required: true, message: "請輸入驗證碼", trigger: "blur" },
          { validator: checkCaptcha, trigger: "blur" }
        ]
      }
    };
  },
  computed: {
    ...mapGetters("modal", {
      getDialogStatus: "getDialogStatus"
    })
  },
  methods: {
    ...mapActions({
      setToken: "login/setToken",
      setDialogStatus: "modal/setDialogStatus",
      setDialogInitialization: "modal/setDialogInitialization",
      setLoginStatus: "login/setLoginStatus"
    }),
    openModal(value, routeW) {
      switch (value) {
        case 1:
          this.setDialogStatus({ status: true, type: value, routeWay: routeW });
          break;
        case 2:
          this.setDialogStatus({ status: true, type: value, routeWay: routeW });
          break;
        default:
          break;
      }
    },
    submitForm(formName) {
      this.$refs[formName].validate(valid => {
        if (valid) {
          if (
            this.loginRule.id_number === loginData.user.userNumber &&
            this.loginRule.user_name === loginData.user.userAccount &&
            this.loginRule.user_password === loginData.user.userPassword &&
            this.loginRule.captcha === this.identifyCode
          ) {
            // this.$alert.alertDialog("login");
            this.setToken("tokenHere").then(() => {
              if (this.$cookie.get("client")) {
                if (loginData.login.isOverThreeMonth) {
                  this.$alert.alertDialog(
                    "親愛的保戶：\n您已經三個月未更新您的密碼，\n提醒您更新您的密碼維護您的帳號安全"
                  );
                }
                //刷新cookie時間回到90天
                this.$cookie.set("client", "canRunTag", "90d");
                localStorage.setItem("userName", "黃明明");
                this.setLoginStatus(true).then(() => {
                  this.$router.push("index");
                });
                // this.$router.push("index");
              } else {
                //呼叫OTP
                this.openModal(2, `index`);
                localStorage.setItem("userName", "黃明明");
                // this.$router.push("loginOTP");
              }
            });
          } else {
            this.$alert.alertDialog("loginFailed", "");
            this.refreshCode();
          }
        } else {
          // console.log("error submit!!");
          this.refreshCode();
          return false;
        }
      });
    },
    signUp() {
      this.$router.push("signUp");
    },
    forgetAccount() {
      this.$router.push("ForgetAccount");
    },
    refreshCode() {
      this.identifyCode = "";
      this.makeCode(this.identifyCodes, 4);
    },
    randomNum(min, max) {
      max = max + 1;
      return Math.floor(Math.random() * (max - min) + min);
    },
    // 隨機生成驗證碼字符串
    makeCode(data, len) {
      if (data) {
        for (let i = 0; i < len; i++) {
          this.identifyCode += data[this.randomNum(0, data.length - 1)];
        }
      }
    }
  },
  beforeMount() {
    this.refreshCode();
  },
  created() {
    this.$router.push(0);
  }
};
</script>
